import React, { useState, useEffect } from "react";

import "./menu.css";

function Recipe() {
  useEffect(() => {
    getData();
  }, []);

  const [item, setItem] = useState([]);

  const getData = async () => {
    const data =
      "https://api.spoonacular.com/recipes/random?number=10&tags=vegetarian,dessert&apiKey=66f3a4d769ef4fe49fa8a7233278bef6";
    fetch(data)
      .then((res) => res.json())
      .then((res) => {
        console.log(res);
        setItem(res.recipe);
      });
  };

  return (
    <div>
      <h2 className="menuTitle">Recipe</h2>
    </div>
  );
}

export default Recipe;
